import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBullseye } from "@fortawesome/free-solid-svg-icons";
import styles from "../App.module.css";

const Setup = () => {
  return (
    <div className={styles.setupContainer}>
      <div className={styles.setupBody}>
        <div className={styles.setupHeader}>
          <h1 className={styles.headerTitle}>Finish Setup</h1>
          <p className={styles.headerDescription}>Complete your account setup to get started!</p>
        </div>

        <div className={styles.cardsContainer}>
          {/* Lose Weight Card */}
          <div className={styles.card}>
            <FontAwesomeIcon icon={faBullseye} className={styles.cardIcon} />
            <h2 className={styles.cardTitle}>Lose Weight</h2>
            <p className={styles.cardDescription}>I want this app to help me lose weight!</p>
            <button className={styles.cardButton}>Select Goal</button>
          </div>

          {/* Gain Weight Card */}
          <div className={styles.card}>
            <FontAwesomeIcon icon={faBullseye} className={styles.cardIcon} />
            <h2 className={styles.cardTitle}>Gain Weight</h2>
            <p className={styles.cardDescription}>I want this app to help me gain weight!</p>
            <button className={styles.cardButton}>Select Goal</button>
          </div>

          {/* Maintain Weight Card */}
          <div className={styles.card}>
            <FontAwesomeIcon icon={faBullseye} className={styles.cardIcon} />
            <h2 className={styles.cardTitle}>Maintain Weight</h2>
            <p className={styles.cardDescription}>I want this app to help me maintain my weight!</p>
            <button className={styles.cardButton}>Select Goal</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Setup;
